    return (
        <nav>
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/news">NewsFeed</Link></li>
                <li><Link to="/favorites">Favorites</Link></li>
                <button onClick={logout}>Logout</button>
            </ul>
        </nav>
    );
};

export default Navbar;
